import React from 'react'
import './Blocks.css'

type BlockProp ={
    num:number,
    color:string,
    isGrid:boolean
}

function Blocks(props:BlockProp) {
    var block1=[],block2=[];
    for(let _i =0;_i<props.num;_i++){
        block1.push(<div className={`hour cell ${props.color}`} style={{borderColor:props.color}}></div>)
    }
    for(let _i =props.num;_i<12;_i++){
        block2.push(<div className={`hour cell`} style={{borderColor:props.color}}></div>)
    }

  return (
    <div className="container">
        <div className={props.isGrid?"grid":""}>
            {block1}
            {block2}
        </div>
    </div>
    )
}

export default Blocks
